import React, { useState, useContext } from 'react';
import { Link } from 'react-router-dom';
import { TextField, Paper, makeStyles, Typography, Button, Box, Grid } from '@material-ui/core';
import { LoginContext } from 'contexts';
import { notify } from 'components';
import { DevModeConfig } from 'configurations';
import { API } from 'helpers';

export const Money = () => {

  return (
    <div>
      <h1>Money Status</h1>
      <h3>Total money ==> 10,000</h3>
      <form>
        <Button variant="contained" color="primary" >Create Coins</Button>
      </form>
    </div>
  )
}
